hebsuperobject.biblemap.put("b33_6_16", new hebsuperobject(33,6,16,"וישתמר חקות עמרי וכל מעשה בית אחאב ותלכו במעצותם למען תתי אתך לשמה וישביה לשרקה וחרפת עמי תשאו׃"));
hebsuperobject.biblemap.put("b33_7_1", new hebsuperobject(33,7,1,"אללי לי כי הייתי כאספי קיץ כעללת בציר אין אשכול לאכול בכורה אותה נפשי׃"));
