hebsuperobject.biblemap.put("b33_7_3", new hebsuperobject(33,7,3,"על הרע כפים להיטיב השר שאל והשפט בשלום והגדול דבר הות נפשו הוא ויעבתוה׃"));
hebsuperobject.biblemap.put("b33_7_4", new hebsuperobject(33,7,4,"טובם כחדק ישר ממסוכה יום מצפיך פקדתך באה עתה תהיה מבוכתם׃"));
